import React, { useState, useEffect } from "react";
import { useNavigate } from "react-router-dom";
import config from "../config";

const RankPage = () => {
  const [rankData, setRankData] = useState(null);
  const [error, setError] = useState(null);
  const navigate = useNavigate();

  useEffect(() => {
    async function fetchRankData() {
      try {
        const response = await fetch(`http://${config.SERVER_URL}/api/rank`);
        if (!response.ok) {
          if (response.status === 404) navigate("/error/404");
          else if (response.status === 500) navigate("/error/500");
          else if (response.status === 503) navigate("/error/503");
          throw new Error(`HTTP error! Status: ${response.status}`);
        }

        const result = await response.json();
        setRankData(result);
      } catch (error) {
        setError("랭킹 데이터를 불러오는 중 오류 발생.");
        console.error("랭킹 데이터 요청 오류:", error);
      }
    }
    fetchRankData();
  }, [navigate]);

  return (
    <div>
      <h2>Rank Page</h2>
      {error ? <p style={{ color: "red" }}>{error}</p> : <p>랭킹 데이터를 불러오는 중...</p>}
      {rankData && <pre>{JSON.stringify(rankData, null, 2)}</pre>}
    </div>
  );
};

export default RankPage;
